    "description": "Gunnar Daniel Frankenberg was a Swedish dentist born on October 9, 1905 in Uddevalla. He completed high school in Uddevalla in 1924, graduated from dental school in 1925, and became a licensed dentist in 1927. He worked as an assistant in Uddevalla from 1927 to 1928, a substitute in Vara from 1928 to 1929, and ran his own practice in Uddevalla afterward. He served as treasurer in the Bohuslän Dental Society from 1934 to 1936, and as vice-chairperson from 1937 onwards. His hobby was fishing."
